{"14": ["Не знаю кому там что воняет.... И зачем его вообще нюхать.... Купили сегодня... Немного пах в начале.... Сейчас муж раскладывает шурупы, никакой вони.... Отличный, функциональный.... Закажу ещё пару)", "2021-04-09T20:38:04Z", "черный, серый", "0", 2, 0, 5, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "15": ["Для мелкого крепежа и сверл и т. д. Отлично.", "2021-04-08T07:43:41Z", "черный, серый", "0", 1, 0, 5, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "16": ["Вместительный. Запах, действительно, ОЧЕНЬ ядовитый.. Бросила на балкон, надеюсь выветрится", "2021-04-06T14:41:17Z", "черный, серый", "0", 2, 0, 4, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "17": ["Отлтчный органайзер, очень понравился, компактный и вместительный. Был запах пластика, но на балконе все выветрилось.", "2021-04-05T08:34:32Z", "черный, серый", "0", 1, 0, 5, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "18": ["Воняет так, что только на улице его открывать, не рекомендую , качество так себе, а главное эта вонь!", "2021-04-05T05:56:44Z", "черный, серый", "0", 2, 0, 1, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "20": ["супер чемоданчик , везде продают типовые , но не вместительные . наконец нашёл то что нужно - всё в одном . супер.", "2021-04-03T16:53:51Z", "черный, серый", "0", 1, 0, 5, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "25": ["Брала мужу. Оценил. Закрывается хорошо, плотно. С двух сторон. Но запах ужасный. И он никогда не вывереется, очень уж сильный...!!! Избавились: три раза \"замачивали\" в воде с разными ароматич.маслами. эвкалип, пихта. Можно брать любые.. В первый раз  сильный ЛЕНОР не помог. Потому, действую проверенным мною способом. И все  китайские запахи удаляю именно так. помогает.. Рекомендую.", "2021-03-30T07:26:13Z", "черный, серый", "0", 2, 0, 5, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "35": ["Возврат.Запах отвратительный.Плохо Переработанный из отходов пластик", "2021-03-16T12:59:49Z", "черный, серый", "0", 2, 0, 1, "Органайзер для крепежа и мелочей универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "52": ["Минус звезда за сильный запах горелой электроники (хотя может это из-за особенностей технологического процесса). В целом более компактный, но не менее вместительный нежели его предшественник из Леруа Мерлен.", "2021-01-28T06:53:50Z", "черный, серый", "0", 3, 0, 4, "Органайзер для крепежа универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "57": ["Запах ужасный ( стоит на балконе выветривается , а так не большой чемоданчик ( кстати двухсторонний) удобен под гвоздики - шурупы ", "2021-01-17T14:34:15Z", "черный, серый", "0", 3, 0, 2, "Органайзер для крепежа универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "58": ["Хороший ящик. Пришло всё без повреждений.", "2021-01-16T05:43:11Z", "черный, серый", "0", 1, 0, 5, "Органайзер для крепежа универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "60": ["Запах ужасный! Второй день лежит на балконе, выветривается.", "2021-01-08T11:33:16Z", "черный, серый", "0", 2, 0, 4, "Органайзер для крепежа универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "61": ["Вонь жуткая,за метр чувствуется", "2021-01-01T21:20:23Z", "черный, серый", "0", 2, 1, 3, "Органайзер для крепежа универсальный двухсторонний 12\" (29.5 х 22 х 7.6 см)", "NEWTON"], "67": ["Органайзер очень маленький. Не смотря на то, что видела размеры в описании, при получении поняла, что он для меня не подойдет. Буду искать размером побольше. Возврат.", "2020-12-21T00:55:22Z", "черный, серый", "0", 0, 1, 5, "Органайзер для крепежа универсальный двухсторонний 12\" (